import React, { Component } from 'react';

class invoicecreatetable extends Component {
    render() {
        const combined=this.props.combined;
        return (
            <div id="invoicecreatetable">
                <table className="table table-bordered" id='datas'>
                    <thead>
                        <tr>
                            <th>Item Details</th>
                            <th>Quantity</th>
                            <th>Price</th>
                            <th>Tax</th>
                            <th>Amount</th>
                        </tr>
                    </thead>
                    <tbody>
                        {combined.map(combine => {
                            return (
                                <tr>
                                    <td>{combine.item}</td>
                                    <td>{combine.quantity}</td>
                                    <td>{combine.price}</td>
                                    <td>{combine.tax}</td>
                                    <td>{combine.amount}</td>
                                </tr>
                            );
                        })}
                    </tbody>
                </table>
            </div>
        );
    }
}

export default invoicecreatetable;
